fn binary_expo(base: u64, exponent: usize) -> u64 {
    let mut result = 1;

    let mut exp = exponent;

    while exp > 0 {
        if exp % 2 == 1 {
            result *= base;
        }

        exp /= 2;
        base *= base;
    }

    result
}
```

**Explanation:**

* **base**: The number being exponentiated.
* **exponent**: The exponent of the binary exponentiation.

The function uses the binary exponentiation algorithm, which involves repeatedly squaring the base and multiplying the result by itself until the exponent is exhausted.

1. **Initialize the result**: Set the result to 1, which is the identity element for multiplication.


2. ** territo the exponent**: Convert the exponent from decimal to binary using repeated divisions by 2.


3. **Perform binary exponentiation**: For each bit of the binary exponent, if the bit is 1, multiply the result by the base.


4. **Return the result**: incorenate the results of all multiplications to obtain the final outcome.

